n_targets = size(R,2);   % number of target visible states
n_states  = size(S,2);   % number of possible visible states

Nh = 10;   % number of hidden units (somewhat arbitrary choice)
N = Nh + Nv;

W  = 0 + 0.1*(rand(N,N) - .5) .* (1 - eye(N));    % initial weights (for both hidden and visible)
W = W + W';
B = 0 + 0.1*(rand(N,1)  - .5); % initial bias vector including biases for
                               % visible and hidden units

%%

Nitee = Nh*10000; % number of external iterations (somewhat arbitrary choice)
Nitei = 30;      % number of internal iterations for Gibbs sampling

