switch annealing
    case 1
        T  =   2*exp(-3*(1:Nitee)/Nitee); % exponential temperature schedule
        ep = .01*exp(-3*(1:Nitee)/Nitee); % exponential stepsize schedule
    case 0
        T  =   2*exp(-3)*ones(1,Nitee);   % fixed temperature
        ep = .01*exp(-3)*ones(1,Nitee);   % fixed stepsize
end


for ite = 1:Nitee
    
    g = @(x) 1./(1 + exp(-2*x/T(ite)));  % logistic function

