        W_indh = W(indh,:);
        s(indh) = double(rand < g(W_indh*s + B(indh)));
        s(indh) = f(s(indh));
    end
    
    vs_gen(ite) = find(sum(repmat(s(1:Nv),1,n_states) == S) == Nv);  % store generated visible state
    
end

