        s(indh) = f(s(indh));
        s(1:Nv) = v_clamp;
    end

    vsc(itc) = find(sum(repmat(s(1:Nv),1,n_states) == S) == Nv); % store generated visible state
    Ec(itc) = - (1/2)*s'*W*s - B'*s;             % store energy

end


